import './App.css';
import CustomerContainer from './containers/CustomerContainer';
import BookingContainer from './containers/BookingContainer';
import TableContainer from './containers/TableContainer';


class App extends Component {
  render() {
    return (
      <>
        <CustomerContainer/>
        <BookingContainer/>
        <TableContainer/>
      </>
    );
  };
};

export default App;
